  false,\n\t\"url\": null,\n\t\"notes\": \"A goose study on Clarence Cannon NWR was
  conducted during the fall of 1970 to determine what habitat types and conditions
  are initially attractive to Canada geese and what habitat types prolong the stay
  of geese throughout the fall into early winter. Since Clarence Cannon NWR is not
  a recent stopping area for geese, the area lends itself to a study of the attraction
  and prolongation of use by geese. Data on blue/snow geese were also collected. Procedures
  were followed as outlined in the Wildlife Management Study No. 2.\",\n\t\"owner_org\":
